#define RST_Pin 9       // PA9 - sx127x reset
#define NSS_Pin 6           // PB6 - Chip Select

// Basic functions for sx127x Library, map according to Hardware!

void sx127x_delay(uint16_t t) {
    // Abstract approach to delay, time in miliseconds
    HAL_Delay(t);
}

void sx127x_rst() {
    HAL_GPIO_WritePin(GPIOA, GPIO_PIN_9, GPIO_PIN_RESET);
    HAL_Delay(2);
    HAL_GPIO_WritePin(GPIOA, GPIO_PIN_9, GPIO_PIN_SET);
    HAL_Delay(18);
}

void NSS() {
    HAL_GPIO_WritePin(GPIOB, GPIO_PIN_6, GPIO_PIN_RESET);
}

void unNSS() {
    HAL_GPIO_WritePin(GPIOB, GPIO_PIN_6, GPIO_PIN_SET);
    delay_us(30);
}

void sx127x_write_reg(uint8_t address, uint8_t value) {

    uint8_t reg_addr = (address | 0x80);        // Mask for write

    NSS();
    HAL_SPI_Transmit(&hspi1, (uint8_t *)&reg_addr, 1, 100);
    HAL_SPI_Transmit(&hspi1, (uint8_t *)&value, 1, 100);
    unNSS();

}

uint8_t sx127x_read_reg(uint8_t address) {
    uint8_t rx_data[2];
    uint8_t tx_data[2];
    tx_data[0] = (address & 0x7F);		// Mask for reading command
    tx_data[1] = 0;						// Dummy
    // TODO: idk if using the same variable is better

    NSS();
    HAL_SPI_TransmitReceive(&hspi1, tx_data, rx_data, 2, 100);
    unNSS();

    return rx_data[1];

}

void sx127x_init() {
    HAL_GPIO_WritePin(GPIOA, GPIO_PIN_9, GPIO_PIN_SET);
    HAL_GPIO_WritePin(GPIOB, GPIO_PIN_6, GPIO_PIN_SET);
    sx127x_rst();

}


// ----------------------------------------

void sx127x_sleep() {
	sx127x_write_reg(0x01, 0x00);			// set REG_OPMODE to sleep (FSK)
}

void sx127x_freq(uint64_t freq, uint32_t offset) {
	freq = freq + offset;
	freq = ((uint64_t)freq << 19) / 32000000;
	sx127x_write_reg(0x06, (freq >> 16));	// Freq MSB
	sx127x_write_reg(0x07, (freq >> 8));	// Freq middle
	sx127x_write_reg(0x08, (freq));		// Freq LSB
}

void sx127x_tx_en() {
	sx127x_write_reg(0x01, 0x0B);			// set REG_OPMODE to TX
	uint8_t res = sx127x_read_reg(0x01);
}

void sx127x_beginFSK() {
	sx127x_sleep();
	sx127x_sleep();
	sx127x_write_reg(0x01, 0x01);			// set REG_OPMODE to Standby(RC) (FSK)
	sx127x_write_reg(0x31, 0x00);			// set Direct modulation

	sx127x_freq(434000000, 0);


	uint8_t regdata;

	regdata = (sx127x_read_reg(0x3B) | 0x40);
	sx127x_write_reg(0x3B, regdata);

	HAL_Delay(10);
	sx127x_write_reg(0x05, 0x00);

}


