#define nop_per_ns 10

void tone(int freq_Hz, int duration_us) {
    int period_ns = 1000000000/(freq_Hz);
    int kilocycles = duration_us*100000/period_ns;
    for (int i = 0; i < kilocycles; i++) {
        GPIOB->BSRR = 1 << 10;
        for (int j = 0; j < period_ns * nop_per_ns / 1000 / 2; j++) {
            asm("nop");
        }
        GPIOB->BSRR = 1 << 26;
        for (int j = 0; j < period_ns * nop_per_ns / 1000 / 2; j++) {
            asm("nop");
        }
    }
}
